import React, { useState } from 'react';
import { Box, Typography, Card, CardContent, Container, Grid, Paper, CircularProgress, LinearProgress, TableContainer, Table, TableHead, TableBody, TableRow, TableCell, Button, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import ProfileForm from '../components/ProfileForm';
import PaperUpload from '../components/PaperUpload';
import MatchResults from '../components/MatchResults';

const MatcherPage = () => {
  const [matches, setMatches] = useState(null);
  const [currentProfile, setCurrentProfile] = useState(null);
  const [detailsOpen, setDetailsOpen] = useState(false);
  const [selectedMatch, setSelectedMatch] = useState(null);

  const handleViewDetails = (match) => {
    setSelectedMatch(match);
    setDetailsOpen(true);
  };

  const handleCloseDetails = () => {
    setSelectedMatch(null);
    setDetailsOpen(false);
  };

  return (
    <Box sx={{ 
      p: 3,
      backgroundColor: '#1a1a1a',
      minHeight: '100vh',
      color: '#fff'
    }}>
      <Container maxWidth="lg">
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Paper sx={{ 
              p: 3, 
              backgroundColor: '#2d2d2d',
              color: '#fff'
            }}>
              <Typography variant="h5" gutterBottom sx={{ color: '#90caf9' }}>
                Patient Profile
              </Typography>
              <ProfileForm 
                onProfileSubmit={(profile) => setCurrentProfile(profile)}
                onMatchResults={(results) => setMatches(results)}
                sx={{
                  '& .MuiInputBase-root': {
                    color: '#fff',
                    backgroundColor: '#1a1a1a'
                  },
                  '& .MuiInputLabel-root': {
                    color: 'rgba(255, 255, 255, 0.7)'
                  },
                  '& .MuiOutlinedInput-notchedOutline': {
                    borderColor: 'rgba(255, 255, 255, 0.23)'
                  },
                  '& .MuiOutlinedInput-root:hover .MuiOutlinedInput-notchedOutline': {
                    borderColor: 'rgba(255, 255, 255, 0.4)'
                  }
                }}
              />
            </Paper>
          </Grid>

          <Grid item xs={12} md={6}>
            <Paper sx={{ 
              p: 3, 
              backgroundColor: '#2d2d2d',
              color: '#fff'
            }}>
              <Typography variant="h5" gutterBottom sx={{ color: '#90caf9' }}>
                Upload Research Paper
              </Typography>
              <PaperUpload />
            </Paper>
          </Grid>

          <Grid item xs={12}>
            <Paper sx={{ 
              p: 3, 
              backgroundColor: '#2d2d2d',
              color: '#fff'
            }}>
              <Typography variant="h5" gutterBottom sx={{ color: '#90caf9' }}>
                Matching Results
              </Typography>
              {matches && (
                <TableContainer>
                  <Table sx={{ 
                    '& .MuiTableCell-root': { 
                      color: '#fff',
                      borderColor: 'rgba(255, 255, 255, 0.1)'
                    }
                  }}>
                    <TableHead>
                      <TableRow>
                        <TableCell>Paper Title</TableCell>
                        <TableCell>Match Score</TableCell>
                        <TableCell>Details</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {matches.map((match) => (
                        <TableRow key={match.paper_id} sx={{
                          '&:hover': {
                            backgroundColor: 'rgba(255, 255, 255, 0.05)'
                          }
                        }}>
                          <TableCell>{match.title}</TableCell>
                          <TableCell>
                            <Box sx={{ display: 'flex', alignItems: 'center' }}>
                              <LinearProgress 
                                variant="determinate" 
                                value={match.score * 100}
                                sx={{
                                  width: 100,
                                  mr: 2,
                                  backgroundColor: 'rgba(255, 255, 255, 0.1)',
                                  '& .MuiLinearProgress-bar': {
                                    backgroundColor: '#90caf9'
                                  }
                                }}
                              />
                              <Typography variant="body2">
                                {(match.score * 100).toFixed(1)}%
                              </Typography>
                            </Box>
                          </TableCell>
                          <TableCell>
                            <Button 
                              variant="outlined" 
                              onClick={() => handleViewDetails(match)}
                              sx={{
                                color: '#90caf9',
                                borderColor: '#90caf9',
                                '&:hover': {
                                  borderColor: '#90caf9',
                                  backgroundColor: 'rgba(144, 202, 249, 0.08)'
                                }
                              }}
                            >
                              View Details
                            </Button>
                          </TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                </TableContainer>
              )}
            </Paper>
          </Grid>
        </Grid>
      </Container>

      <Dialog
        open={detailsOpen}
        onClose={handleCloseDetails}
        maxWidth="md"
        fullWidth
        PaperProps={{
          sx: {
            backgroundColor: '#2d2d2d',
            color: '#fff'
          }
        }}
      >
        <DialogTitle sx={{ color: '#fff' }}>Match Details</DialogTitle>
        <DialogContent dividers sx={{
          borderColor: 'rgba(255, 255, 255, 0.1)'
        }}>
          {selectedMatch && (
            <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
              <Typography variant="h6" sx={{ color: '#90caf9' }}>
                {selectedMatch.title}
              </Typography>
              <Typography>
                Match Score: {(selectedMatch.score * 100).toFixed(1)}%
              </Typography>
            </Box>
          )}
        </DialogContent>
        <DialogActions sx={{ borderTop: '1px solid rgba(255, 255, 255, 0.1)' }}>
          <Button 
            onClick={handleCloseDetails}
            sx={{ 
              color: '#90caf9'
            }}
          >
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default MatcherPage;
